import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Login } from './login/Login';

export function MainPreSite() {
    const navigate = useNavigate();

    // You can use this function to navigate to the App component after logging in
    const handleLogin = () => {
        // Perform your login logic

        // If login is successful, navigate to the App component
        navigate('/App');
    };

    return (
        <div>
            <Login onLogin={handleLogin} />
        </div>
    );
}
